import Logo from "./Logo";
import "./Nav.css";

const Nav = ({ setSelectedButton, logoButton, logoText }) => {
  return (
    <div className="nav">
      <Logo logoButton={logoButton} logoText={logoText} />
      <NavButtons setSelectedButton={setSelectedButton} />
    </div>
  );
};

export default Nav;
